dtmc

const int length = 500; // road length
const int max_time = 30; // maximum time of experiment
const int v1 = 30;
const int x1_0 = 5;

global actrState : [1..3] init 1; // active module: 1 = control (both cars), 2 = decision making, 3 = monitoring
global lC : bool init false; // lane changing occuring? 
global t : [0..max_time] init 0; // time 
global crashed : bool init false; 

formula x1 = x1_0 + v1*t;
formula dist = x1>x?(x1 - x):(x - x1);

module Decision_Making

 	// If a crash occurs, then nothing else can happen
	[] crashed -> 1:(crashed' = true);

	[] actrState = 2 & dist < 10 -> 1:(lC' = true) & (actrState' = 1);
	[] actrState = 2 & dist >= 10 -> 1:(actrState' = 1);
endmodule

module Control

